function AJapan({
    x,
    y,
    country,
    onClick,
    onMouseEnter,
    onMouseExit,
    selectedCountry,
    hoveredCountry,
    // parameters/methods
}) {
    return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 1 500 300"
            width= "310px"
            style={{ position: "absolute", left: x, top: y }}
        >

            <path
                className="shape"
                onClick={onClick}
                onMouseEnter={onMouseEnter}
                onMouseLeave={onMouseExit}
                fill={selectedCountry === country ? "red" : "gray"}
                stroke={hoveredCountry === country ? "red" : "black"}
                id="Ancient Korea"
                stroke-width="1"
                />

        </svg>
    );
}
export default AJapan;
